import React from "react";
import Post from "./post/Post";
import classes from "./Posts.module.css";

function Posts() {
  let postData = [
    { id: 0, message: "Hi, bird, how are you?!", likeCount: "15" },
    { id: 1, message: "Lets fire", likeCount: "10" },
    { id: 2, message: "U smell like sheep", likeCount: "7" },
  ];

  return (
    <div className={classes.posts}>
      <div className={classes.area}>
        <textarea></textarea>
        <br />
        <button>Add</button>
        <button>Clear</button>
      </div>
      <div className={classes.postsItem}>
        My posts
        <Post likeCount={postData[0].likeCount} message={postData[0].message} />
        <Post likeCount="20" message="Lets fire" />
        <Post likeCount="7" message="U smell like sheep" />
      </div>
    </div>
  );
}
export default Posts;
